(function() {
    "use strict";
    jQuery.sap.declare("sap.ui.mw.DocumentsBase");
    jQuery.sap.require("sap.ui.base.Object");
    jQuery.sap.require("js.base.BusyBase");

    sap.ui.base.Object.extend('sap.ui.mw.DocumentsBase', {
        constructor: function(oTblName, oBtnTriggerDocs) {
            this.setIdTblDocuments(oTblName);
            this.setBtnTrigger(oBtnTriggerDocs);
            this.setBlockByStatus(false);
            var busyLoader = new sap.ui.mw.BusyBase();
            this.setBusyLoader(busyLoader);

        }
    });

    sap.ui.mw.DocumentsBase.prototype.loadDataInTableDocuments = function(oModel) {
        return new Promise(function(resolve) {
            var oCurrentBase, oDocumentsListTable;
            oCurrentBase = this;
            oDocumentsListTable = sap.ui.getCore().byId(oCurrentBase.getIdTblDocuments(), "items");
            oDocumentsListTable.setModel(oModel);
            oDocumentsListTable.bindAggregation("items", {
                path: oCurrentBase.getPathEntity(),
                factory: function(_id, _context) {
                    return oCurrentBase.bindList(_context);
                }
            });
            resolve("ok");
        }.bind(this));
    }

    sap.ui.mw.DocumentsBase.prototype.initValidateModel = function(oModel) {
        jQuery.sap.require("js.base.FileBase");
        var oCurrentBase = this;
        return new Promise(function(resolve) {
            var oFileBase;
            oFileBase = new sap.ui.mw.FileBase();
            oFileBase.loadFile("data-map/catalogos/statusDocuments.json")
                .then(oCurrentBase.sourceStatusDocuments.bind(oCurrentBase, oModel, this.getPathEntity(), oFileBase))
                .then(resolve)
        }.bind(oCurrentBase));
    }

    sap.ui.mw.DocumentsBase.prototype.sourceStatusDocuments = function(oModel, oPath, oFileBase, oModelStatus) {
        var oCurrentBase = this;
        return new Promise(function(resolve) {
            oFileBase.loadFile("data-map/catalogos/dataMissingDocuments.json")
                .then(oCurrentBase.renderToViewModel.bind(oCurrentBase, oModel, oPath, oModelStatus))
                .then(resolve)
        });
    }

    sap.ui.mw.DocumentsBase.prototype.renderToViewModel = function(oModel, oPath, oModelStatus, oResult) {
        var _oModelStatus, oCurrentBase;
        _oModelStatus = oModelStatus;

        return new Promise(function(resolve) {
            oCurrentBase = this;
            oModel.getProperty(oPath).forEach(function(item, i) {
                oModel.setProperty(oPath + "/" + i + "/title", oResult.getProperty("/" + (oModel.getProperty(oPath + "/" + i + "/DocumentId")) + "/title"));

                oModel.setProperty(oPath + "/" + i + "/front-back", oResult.getProperty("/" + (oModel.getProperty(oPath + "/" + i + "/DocumentId")) + "/front-back"));


                oModel.setProperty(oPath + "/" + i + "/status",
                    _oModelStatus.getProperty("/" +
                        (
                            oModel.getProperty(oPath + "/" + i + "/DocumentStatusId") === "" ? "empty" : oModel.getProperty(oPath + "/" + i + "/DocumentStatusId")
                        )
                    )
                );
                // oModel.setProperty(oPath + "/" + i + "/status", _oModelStatus.getProperty("/" + oModel.getProperty(oPath + "/" + i + "/DocumentStatusId")));

                oModel.setProperty(oPath + "/" + i + "/viewCameraField",
                    (
                        oCurrentBase.getBlockByStatus()
                        // (oModel.getProperty(oPath + "/" + i + "/DocumentStatusId") === "ACE") || oCurrentBase.getBlockByStatus()
                    ) ?
                    (
                        //false
                        //(oModel.getProperty(oPath + "/" + i + "/DocumentStatusId") === "ZA1") ? true : false
                        //Work around para cuando las imagenes vienen sin captura y se necesita tomar la foto en Productivo...
                        (oModel.getProperty(oPath + "/" + i + "/DocumentStatusId") === "ZA1" ||
                            oModel.getProperty(oPath + "/" + i + "/DocumentStatusId") === ""
                        ) ? true : false
                    ) :
                    true
                );
                // oModel.setProperty(oPath + "/" + i + "/viewCameraField", (oModel.getProperty(oPath + "/" + i + "/DocumentStatusId") === "ACE") ? false : true);
                oModel.setProperty(oPath + "/" + i + "/viewInTable",
                    (typeof oCurrentBase.getVisibleMyPendingImage() === "undefined" ? true : (oModel.getProperty(oPath + "/" + i + "/DocumentId") === oCurrentBase.getVisibleMyPendingImage() ? true : oCurrentBase.getLongList())

                    ));
            })
            resolve("ok");
        }.bind(this));
    }

    sap.ui.mw.DocumentsBase.prototype.unBuildModel = function(oModel, oPath) {
        return new Promise(function(resolve) {
            oModel.getProperty(oPath).forEach(function(item, i) {
                delete item.title;
                delete item["front-back"];
                delete item.status;
                delete item.viewCameraField;
                delete item.viewInTable;
                delete item.__metadata;
            })
            oModel.refresh(true);
            resolve("ok-unBuild");
        }.bind(this));
    }

    sap.ui.mw.DocumentsBase.prototype.bindList = function(_context) {
        jQuery.sap.require("js.base.DisplayBase", "js.base.ActionBase");
        var oDisplayBase, oActionBase, oDocumentsColumnTemplate, oCurrentBase;
        oCurrentBase = this;
        oDisplayBase = new sap.ui.mw.DisplayBase();
        oActionBase = new sap.ui.mw.ActionBase();
        oDocumentsColumnTemplate = new sap.m.ColumnListItem({});
        oDocumentsColumnTemplate.addCell(new sap.m.ObjectHeader({
            title: _context.getProperty("title"),
            titleActive: true,
            responsive: true,
            backgroundDesign: "Translucent",
            fullScreenOptimized: true,
            attributes: [
                new sap.m.ObjectAttribute({
                    text: _context.getProperty("front-back")
                }),
                new sap.m.ObjectAttribute({
                    text: (_context.getProperty("DocumentStatusText") === "" ? "Sin Captura" : _context.getProperty("DocumentStatusText")),
                    active: true
                }),
                new sap.m.ObjectAttribute({
                    text: _context.getProperty("status")
                })
            ]
        }));
        oDocumentsColumnTemplate.addCell(oActionBase.createButton("", "", "Accept", "sap-icon://camera", oCurrentBase.showCaptureImageBp.bind(this, _context.sPath), oCurrentBase).setVisible(_context.getProperty("viewCameraField")).addStyleClass("btnCameraFragmentDocuments"));
        oDocumentsColumnTemplate.setVisible(_context.getProperty("viewInTable"));
        return oDocumentsColumnTemplate;
    }

    sap.ui.mw.DocumentsBase.prototype.closeDialogDocuments = function() {
        sap.ui.getCore().byId("oButtonCloseDocuments").setEnabled(false);
        var rederModelToClose = this.unBuildModel(sap.ui.getCore().byId(this.getIdTblDocuments()).getModel(), this.getPathEntity());
        rederModelToClose
            .then(this.readyToCloseDialogDocuments.bind(this))
            .catch(this.errorCloseDialog.bind(this))
    }
    sap.ui.mw.DocumentsBase.prototype.readyToCloseDialogDocuments = function(oResult) {
        this.getOFragment().close();
        this.getOFragment().destroy();
        console.log("-->CERRANDO FRAGMENT DOCUMENT");
    }

    sap.ui.mw.DocumentsBase.prototype.errorCloseDialog = function(oResult) {
        this.readyToCloseDialogDocuments();
        console.log("-->neutralizando Error: " + oResult + " <--");
    }

    sap.ui.mw.DocumentsBase.prototype.showCaptureImageBp = function(sCurrentPath, oEvent) {
        jQuery.sap.require("js.base.NavigatorBase");
        var oNavigatorBase = new sap.ui.mw.NavigatorBase();
        // sap.ui.getCore().byId("oDialogDocuments").setBusy(true);
        this.getBusyLoader().show("Cargando...");
        sap.ui.getCore().byId(oEvent.getSource().sId).setEnabled(false);

        if (!oNavigatorBase.testUserAgent()) {
            this.onPhotoDataSuccess(sCurrentPath, "");
        } else {
            /***********Funcion correcta para continuar con el flujo, quitar lo demas cuando pase a produccion, el codigo extra solo es para que simular el funcionamiento en mockserver o sea en modo web****************/
            navigator.camera.getPicture(this.onPhotoDataSuccess.bind(this, sCurrentPath), this.onFail.bind(this), {
                quality: 40,
                targetWidth: 980,
                targetHeight: 980,
                destinationType: Camera.DestinationType.DATA_URL
            });
            /***************************/
        }
    }

    sap.ui.mw.DocumentsBase.prototype.onPhotoDataSuccess = function(sCurrentPath, imageData) {
        sap.ui.getCore().byId(this.getIdTblDocuments()).getModel().setProperty(sCurrentPath + "/DocumentStatusText", "DOCUMENTO CAPTURADO");
        sap.ui.getCore().byId(this.getIdTblDocuments()).getModel().setProperty(sCurrentPath + "/ImageBase64", imageData);
        sap.ui.getCore().byId(this.getIdTblDocuments()).getModel().refresh(true);
        // sap.ui.getCore().byId("oDialogDocuments").setBusy(false);
        this.getBusyLoader().close();
        this.setFlagImageSuccess(true);

    }
    sap.ui.mw.DocumentsBase.prototype.onFail = function() {
        console.log("-->error");
        sap.ui.getCore().byId(this.getIdTblDocuments()).getModel().refresh(true);
        // sap.ui.getCore().byId("oDialogDocuments").setBusy(false);
        this.getBusyLoader().close();
        sap.m.MessageToast.show("Por favor intentelo de nuevo");
    }
    sap.ui.mw.DocumentsBase.prototype.onFailLoadModel = function() {
        console.log("-->error sin ImageSet");
        this.closeDialogDocuments();
        sap.m.MessageToast.show("No es posible actualizar las imgenes del cliente debido a un problema en el expediente electrnico. Por favor consulta al administrador de expediente electrnico.");
        // sap.m.MessageToast.show("No hay imagenes asociadas. Por favor intentelo de nuevo ms tarde.");
    }
    sap.ui.mw.DocumentsBase.prototype.setIdTblDocuments = function(oTblName) {
        this.oTblName = oTblName;
    };
    sap.ui.mw.DocumentsBase.prototype.getIdTblDocuments = function() {
        return this.oTblName;
    };

    sap.ui.mw.DocumentsBase.prototype.setOFragment = function(oFragment) {
        this.oFragment = oFragment;
    };
    sap.ui.mw.DocumentsBase.prototype.getOFragment = function() {
        return this.oFragment;
    };

    sap.ui.mw.DocumentsBase.prototype.setPathEntity = function(oPath) {
        this.oPath = oPath;
    };
    sap.ui.mw.DocumentsBase.prototype.getPathEntity = function() {
        return this.oPath;
    };
    sap.ui.mw.DocumentsBase.prototype.setBtnTrigger = function(oBtn) {
        this.oBtn = oBtn;
    };
    sap.ui.mw.DocumentsBase.prototype.getBtnTrigger = function() {
        return this.oBtn;
    };
    sap.ui.mw.DocumentsBase.prototype.setFlagImageSuccess = function(oFlagSuccess) {
        this.oFlagSuccess = oFlagSuccess;
    };
    sap.ui.mw.DocumentsBase.prototype.getFlagImageSuccess = function() {
        return this.oFlagSuccess;
    };
    sap.ui.mw.DocumentsBase.prototype.setVisibleMyPendingImage = function(myPendingImage) {
        this.myPendingImage = myPendingImage;
    };
    sap.ui.mw.DocumentsBase.prototype.getVisibleMyPendingImage = function() {
        return this.myPendingImage;
    };
    sap.ui.mw.DocumentsBase.prototype.setLongList = function(LongList) {
        this.LongList = LongList;
    };
    sap.ui.mw.DocumentsBase.prototype.getLongList = function() {
        return this.LongList;
    };
    sap.ui.mw.DocumentsBase.prototype.setBlockByStatus = function(BlockByStatus) {
        this.BlockByStatus = BlockByStatus;
    };
    sap.ui.mw.DocumentsBase.prototype.getBlockByStatus = function() {
        return this.BlockByStatus;
    };
    sap.ui.mw.DocumentsBase.prototype.setBusyLoader = function(BusyLoader) {
        this.BusyLoader = BusyLoader;
    };
    sap.ui.mw.DocumentsBase.prototype.getBusyLoader = function() {
        return this.BusyLoader;
    };
})();
